import React from "react";
import { useNavigate } from "react-router-dom";
import styles from './Dashboard.module.scss';
import Logo from "../../../assets/CI_Logo.png";
import ProfOr from "../../../assets/Prof_Or.png";
import { Button } from "@mui/material";

const Dashboard = () => {
  const navigate = useNavigate();

  return (
    <div className={styles['dashboard-container']}>
      {/* Header with logo and navigation */}
      <header className={styles.header}>
        <div className={styles.logo}>
          <img src={Logo} alt="Class Insights Logo" />
        </div>

        <nav className={styles.navigation}>
          <button className={styles.navButton + ' ' + styles.active}>New Assignment</button>
          <button className={styles.navButton}>Past Assignments</button>
          <button className={styles.navButton}>AI Settings</button>
          <button className={styles.navButton}>Classes</button>
        </nav>

        <div className={styles.userProfile}>
          <div className={styles.courseInfo}>
            <span>Business Association</span>
            <span className={styles.courseCode}>LAW100 B</span>
          </div>
          <img src={ProfOr} alt="User Profile" className={styles.profileImage} />
        </div>
      </header>

      {/* Main content */}
      <main className={styles.mainContent}>
        <h1>Start Assignment</h1>

        <div className={styles.assignmentCards}>
          <div className={styles.card}>
            <img 
              src="https://media.istockphoto.com/id/1366724877/photo/rear-view-of-mature-teacher-talking-to-his-student-during-lecture-at-university-classroom.jpg?s=612x612&w=0&k=20&c=PYpAFHxiUKX2i1D8w_ElnGsm1B64GBleyF-DfYTLcN0=" 
              alt="Live Class"
              className={styles.cardImage}
            />
            <h2>Live</h2>
            <p>Real-Time Class Demo</p>
            <Button 
              variant="contained"
              onClick={() => navigate("/livedemo")} 
              className={styles.beginButton}
            >
              Begin
            </Button>
          </div>

          <div className={styles.card}>
            <img 
              src="https://st2.depositphotos.com/1010550/8538/i/450/depositphotos_85380848-stock-photo-beautiful-young-woman-working-with.jpg"
              alt="Asynchronous"
              className={styles.cardImage}
            />
            <h2>Asynchronous</h2>
            <p>At-Home Assignments</p>
            <Button 
              variant="contained"
              onClick={() => navigate("/asyncdemo")} 
              className={styles.beginButton}
            >
              Begin
            </Button>
          </div>
        </div>
      </main>
    </div>
  );
};

export default Dashboard;
